import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import Alert from "./Alert"; // Assuming this is where the Alert component is located.

const Partners = () => {
  const [partners, setPartners] = useState([]);
  const [partnerType, setPartnerType] = useState("customer"); // Default to 'customer'
  const [alert, setAlert] = useState(null);
  const navigate = useNavigate();

  // Fetch partner data based on partner type
  useEffect(() => {
    const fetchPartners = async () => {
      try {
        const response = await fetch(`/partners?type=${partnerType}`);
        if (response.ok) {
          const data = await response.json();
          setPartners(data);
        } else {
          const errorData = await response.json();
          setAlert({ type: "error", message: errorData.message || "Failed to fetch partners." });
        }
      } catch (error) {
        setAlert({ type: "error", message: "An error occurred while fetching partners." });
      }
    };
    fetchPartners();
  }, [partnerType]);

  const handleEditPartner = (partnerId) => {
    navigate(`/edit-partner?id=${partnerId}`);
  };

  const handleAddPartner = () => {
    navigate(`/add-partner?type=${partnerType}`);
  };

  return (
    <div className="container mt-5">
      {alert && <Alert type={alert.type} message={alert.message} className="mb-4" />}
      <div className="card shadow-lg border-0">
        <div className="card-header bg-gradient-primary text-white d-flex justify-content-between align-items-center">
          <h3 className="mb-0">Partners List</h3>
          <button className="btn btn-success" onClick={handleAddPartner}>
            <i className="fa fa-plus"></i> Add Partner
          </button>
        </div>
        <div className="card-body">
          <div className="mb-3">
            <label htmlFor="partnerType" className="form-label">
              Partner Type
            </label>
            <select
              className="form-select"
              id="partnerType"
              value={partnerType}
              onChange={(e) => setPartnerType(e.target.value)}
            >
              <option value="customer">Customer</option>
              <option value="vendor">Vendor</option>
            </select>
          </div>
          <div className="table-responsive">
            <table className="table table-bordered table-hover">
              <thead className="table-primary">
                <tr>
                  <th>Full Name</th>
                  <th>Email</th>
                  <th>Contact Number</th>
                  <th>Status</th>
                  <th>Opening Balance</th>
                  <th>Representative Name</th>
                  <th>Representative Contact</th>
                  <th>Actions</th>
                </tr>
              </thead>
              <tbody>
                {partners.length > 0 ? (
                  partners.map((partner) => (
                    <tr key={partner.id}>
                      <td>{`${partner.firstName} ${partner.lastName}`}</td>
                      <td>{partner.email}</td>
                      <td>{partner.contactNo}</td>
                      <td>{partner.status}</td>
                      <td>{partner.openingBalance}</td>
                      <td>{partner.repName}</td>
                      <td>{partner.repContact}</td>
                      <td>
                        <button
                          className="btn btn-primary btn-sm"
                          onClick={() => handleEditPartner(partner.id)}
                        >
                          <i className="fa fa-edit"></i> Edit
                        </button>
                      </td>
                    </tr>
                  ))
                ) : (
                  <tr>
                    <td colSpan="8" className="text-center">
                      No partners found.
                    </td>
                  </tr>
                )}
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Partners;
